const canvas = document.getElementById("canvas1");
const ctx = canvas.getContext('2d'); //grants permission to enter into 2d canvas
canvas.width = 800;
canvas.height = 450;

const image1 = new Image();
//image1.src = 'image.jpg'; //requires image to be locally loaded
image1.src = 'data:image/jpeg;base64,'
// now we've converted image into a collection of string that browser develops on its own. Basically converted "JPG to Base 64"

image1.addEventListener('load', function () {
    ctx.drawImage(image1, 0, 0, canvas.width, canvas.height); // as soon as the image loads canvas draws it now
    const scannedImage = ctx.getImageData(0, 0, canvas.width, canvas.height); // stores color of each pixel
    console.log(scannedImage);
    const scannedData = scannedImage.data; // storing data(pixel info) in separate variable

    for (let i = 0; i < scannedData.length; i += 4) { //since a pixel is made of 4 elements of array
        const total = scannedData[i] + scannedData[i + 1] + scannedData[i + 2];
        // turning image into grayscale by averaging all 3 r g b elements' value
        const averageColorValue = total / 3;
        scannedData[i] = averageColorValue;
        scannedData[i + 1] = averageColorValue;
        scannedData[i + 2] = averageColorValue;
    }
    scannedImage.data = scannedData; //replaced the original data with manipulated data
    ctx.putImageData(scannedImage, 0, 0); // redraws the image into canvas
})